import logo from './logo.svg';
import './App.css';

import { motion, useScroll } from "framer-motion";

function App() {
  const { scrollYProgress } = useScroll();
  return (
    <div className="App">
      <motion.div
        className="progress-bar"
        style={{ scaleX: scrollYProgress }}
      />
      <header className="App-header">
          <h1>Test</h1>
      </header>
    </div>
  );
}

export default App;
